profiles.description:
I'm a Upwork Pro Mobile iOS & Top Rated developer.

Hi, My name is Nikita.
During my career as iOs developer I've done more than 10 projects: from small one to really huge. You can see some of them in my portfolio. 

I am client-oriented developer and I really like to provide high-quality service. My #1 goal is to work to strict deadlines to ensure that projects are delivered on time and to budget.  At the beginning of a new project, I like to speak with the client, so that I can have a clear understanding of his/her needs and vision of the project.

I have a Master in Computer Science and Software Engineering (Ufa State Aviational Technical University).

Since 2011, I'm programmer in Bank field (Oracle pl/sql) where I was dealing with large amount of important data (big data & high load). I was taking part in all stages of software's lifecycle,  including analysis, developing, testing and deploying. Also I was responsible for mentoring, code review, writing detailed technical specification, test scenarios, controlling strict deadlines to ensure project delivery on time and to budget.

Since 2013, I've been developing iOs applications as a fulltime developer. Please take a look at my work history for comments from other clients. 

Thank you in advance for your time and consideration. I look forward to working with you soon.

Here is list of my skills (technologies I worked with):
— iOs (6, 7, 8, 9): Core Data (Magical Record), Autolayout, Multithreading (with GCD and NSOperationQueue), Push notifications (via Parse.com), Social network integration (VK, Facebook. Odnoklassniki), Sockets, REST API, Parse.com backend;
— Objective C / Swift
— Unit testing with OCMock
— Dependency injection (Typhoon framework)
— Frameworks: AFNetworking, MagicalRecord, SDWebImage, SWRevealController, AFIncrementalStorage;
— Core web: XML, JSON, HTML/CSS, JavaScript;
— IDE: XCode;
— OS: Windows, Mac OS X;
— VCS: Git;
— Bug/Issue trackers: Jira, Assembla, Redmine, Trello;
— SQL;
— UML.

